var seletedMenuId = "dashboard";
var vueOBJ = null;

function getSuper_RealIds_By_Menu_ids(menuids, realids) {
  if (vueOBJ !== null) for (var i = 0; i < menuids.length; i++) {
    for (var j = 0; j < vueOBJ.$store.state.permission.length; j++) {
      var oj = vueOBJ.$store.state.permission[j];
      if (menuids[i] == oj.menu_id) realids.push(oj.id);
    }
  }
}

function getSuperMenu_Ids(menuidstr, pidlists) {
  var len = menuidstr.split('-').length;
  if (len < 2) return;
  var mulist = menuidstr.split('-');
  var idstr = '';

  for (var i = 0; i < len - 1; i++) {
    idstr += mulist[i] + '-';
  }

  idstr = idstr.substr(0, idstr.length - 1);
  pidlists.push(idstr);
  getSuperMenu_Ids(idstr, pidlists);
}

function subMenuPermissionState(permissionlist) {
  var ul_group_list = new Array();
  var showmenulist = new Array();

  for (var i = 0; i < permissionlist.length; i++) {
    var r = permissionlist[i].read;
    var w = permissionlist[i].write;
    var c = permissionlist[i].create;
    var d = permissionlist[i]["delete"];
    var lv = permissionlist[i].level;
    var id = permissionlist[i].id;
    var menu_id = permissionlist[i].menu_id;
    $('a#' + id).closest('li').css('display', 'none');

    if (parseInt(lv) === 1 && id.split('-').length > 0 && id.substr(0, 2) === 'm-') {
      ul_group_list.push(id.split('-')[1]);
      $('ul#' + id.split('-')[1]).css('display', 'none');
    }

    if (parseInt(r) === 1 || parseInt(w) === 1 || parseInt(c) === 1 || parseInt(d) === 1) showmenulist.push(permissionlist[i]);
  }

  var ul_first = 0;

  for (var j = 0; j < showmenulist.length; j++) {
    var show_objs = showmenulist[j];
    var id = show_objs.id; //m-dashboard

    var p_id = show_objs.p_id;
    var menu_id = show_objs.menu_id; //"1-1"

    var id_len = id.split('-').length;

    if (id_len > 0) {
      /*= show main menu and ul group =*/
      var st_id = id.split('-')[0];

      for (var jj = 0; jj < ul_group_list.length; jj++) {
        var ul_obj_id = ul_group_list[jj];
        var m_mu = 'm-' + ul_obj_id;

        if (st_id == ul_obj_id) {
          if (ul_first == 0) {
            $('a#' + m_mu).addClass('active');
            $('ul#' + ul_obj_id).css('display', 'block');
          }

          $('a#' + m_mu).closest('li').css('display', 'block');
          ul_group_list.splice(jj, 1);
          ul_first = 1;
        }
      }
      /* === */

    }

    var menu_id_len = menu_id.split('-').length;

    if (menu_id_len > 0) {
      var menuidArray = new Array();
      getSuperMenu_Ids(menu_id, menuidArray);
      var realsuperArray = new Array();
      getSuper_RealIds_By_Menu_ids(menuidArray, realsuperArray);

      if (realsuperArray.length > 0) {
        for (var ii = 0; ii < realsuperArray.length; ii++) {
          var oj = realsuperArray[ii];
          var css = $('a#' + oj).closest('li').css('display');
          if (css !== 'block') $('a#' + oj).closest('li').css('display', 'block');
        }
      }
    }

    $('#' + id).closest('li').css('display', 'block');

    if (j == 0) {
      vueOBJ.SetMenuChange(id);
    }
  }
}

function windowlocationurlchange() {
  var urlstr = window.location.href;

  if (urlstr.indexOf('fastreg=') > -1) {
    var urlstr_a = urlstr.split('fastreg');
    window.location.href = urlstr_a[0];
  }
}

